import { useState } from "react";

function InfoComment ({ commentPro }) {
    let hi = commentPro;
    const [comment, setComment] = useState(hi);

    function promiseClick () {
        setComment('');
    }
    return (
        <div className='info-comment-container' onClick={promiseClick}>
            <input type='text' value={comment}></input>
        </div>
    )
}

export default InfoComment;
